import React from 'react';
import styles from './presentation.css';

const Presentation = () => {
  return (
    
    
      <div className={styles.content}>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. In euismod, ante et bibendum rhoncus, lacus odio fringilla arcu, vel aliquam nisl purus eget nunc.
        </p>
        <ul className={styles.rectangles}>
          <li className={styles.rectangle}>
            <img src="./Images/bus.png" alt="Bus" />
            <p>Bus Service</p>
          </li>
          <li className={styles.rectangle}>
            <img src="./Images/sport.png" alt="Entrainement" />
            <p>Entrainement</p>
          </li>
          <li className={styles.rectangle}>
            <img src="./Images/family.png" alt="Suivie psychologique et orthophonique et nutuniste" />
            <p>Suivie psychologique et orthophonique et nutuniste</p>
          </li>
          <li className={styles.rectangle}>
            <img src="./Images/teacher.png" alt="Les meilleurs professeurs" />
            <p>Les meilleurs professeurs</p>
          </li>
        </ul>
      </div>
   
  );
};

export default Presentation;
